import React from 'react';
import { Link } from 'react-router-dom'

const Presentation = () => {
    return (
        <div className="callAction">
            <ul>
                <li><Link to="/colivings/:city">Colivings</Link></li>
            </ul>
        </div>
    )
}

export default Presentation
